import * as React from 'react';
import {Link, useNavigate} from 'react-router-dom';

export default function RegisterLink() {
    let navigate = useNavigate();

    const toRegister = () =>{ 
        let path = `register`; 
        navigate(path);
    }


    return (
<Button
    key="toRegister"
    onClick={() => toRegister()}
    sx={{color: 'white', display: 'block'}}
></Button>
    )
}
